export default function Card(props) {
   const values = {props};
   return (
      <div>
          <button onClick={values.onClose}>X</button>
         <h2>{values.name}</h2>
         <h2>{values.status}</h2>
         <h2>{values.species}</h2>
         <h2>{values.status}</h2>
         <h2>{values.gender}</h2>
         <img src={values.origin.url} alt='values.origin.name' /> 
      </div>
   );
}
